        public void ProcessForm(mshtml.HTMLDocument htmlDoc, String strPageIndex)
        {
            switch (strYA)
            {
                case "2008":
                    ProcessFormB2008(htmlDoc, strPageIndex);
                    break;
                case "2009":
                    ProcessFormB2009(htmlDoc, strPageIndex);
                    break;
                case "2010":
                    ProcessFormB2010(htmlDoc, strPageIndex);
                    break;
                //LEESH FEB 2012
                case "2011":
                    ProcessFormB2011(htmlDoc, strPageIndex);
                    break;
                case "2012":
                    ProcessFormB2012(htmlDoc, strPageIndex);
                    break;
                //LEESH END
				case "2013":
                    ProcessFormB2013(htmlDoc, strPageIndex);
                    break;
                case "2014":
                    ProcessFormB2014(htmlDoc, strPageIndex);
                    break;
                case "2015":
                    ProcessFormB2015(htmlDoc, strPageIndex);
                    break;

                case "2016":
                    ProcessFormB2016(htmlDoc, strPageIndex);
                    break;

                //case "2017":
                //    ProcessFormB2017(htmlDoc, strPageIndex);
                //    break;
            }
        }

